import React, {Component} from 'react';
import {Button} from "@material-ui/core";

class LandingPage extends React.Component{
    render() {
        return(
        <div>
            <h1>Landing Page</h1>
            <Button variant={"contained"} color={"primary"}> Hello World! </Button>
        </div>
            
        );
    }

}
export default LandingPage;
